webpackJsonp([39272586787828],{412:function(e,A){e.exports={data:{markdownRemark:{html:'<p>If you are new to fiddles, it\'s an online code playground that let\'s you\nquickly experiment, visualize results and share code without having to start\nup an IDE, editor or server of some sort.</p>\n<p>They are generally free and include features such as syntax highlighting,\nresults preview, reference dependencies, sharing, code forking and\nembedding demonstrations into web pages.</p>\n<p>There are fiddles available for all sorts of languages whether it be markup,\nscripting, styling, pre-processing, compiled, declarative, functional,\nyou name it. <a href="https://fiddles.io/">Fiddles.io</a> has a great catalog to help\nyou discover them.</p>\n<p><b>Side note</b>: Funny enough, there is also a fiddle for an esoteric programming language called\n<a href="https://en.wikipedia.org/wiki/Brainfuck">Brainfuck</a> - <em>the name really says\nit all about this language</em>.</p>\n<p>In this post I\'ll be sharing some use cases with you as well as some of my\ncurrently favorite fiddle editors.</p>\n<h2 id="usages"><a href="#usages" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Usages</h2>\n<p>You can use fiddles for just about anything. Some examples include:</p>\n<ul>\n<li>Provide a visual &#x26; interactive answer to a question</li>\n<li>Embed a code sample that can be executed on your blog</li>\n<li>Familiarize yourself with or learn a language before you adopt it</li>\n<li>Quickly test behavior and quirks of a language</li>\n<li>Build a test case for a bug</li>\n<li>Showcase your skills</li>\n<li>Get inspiration and design patterns for your projects from other fiddles</li>\n</ul>\n<h2 id="codepen"><a href="#codepen" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>CodePen</h2>\n<p><a href="http://codepen.io/">CodePen</a> refers to their fiddles as "Pens". Pens can\nbe created for any front end web experiment you wish you create.</p>\n<p>To find out more, you can <a href="https://codepen.io/hello/">read about</a> CodePen and\nits super cool editor.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/codepen-3b3cf4a4706af4d88969562639ed8341-67d4c.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 600px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 58.333333333333336%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Screenshot"\n        title="CodePen layout"\n        src="/static/codepen-3b3cf4a4706af4d88969562639ed8341-67d4c.jpg"\n        srcset="/static/codepen-3b3cf4a4706af4d88969562639ed8341-8a113.jpg 173w,\n/static/codepen-3b3cf4a4706af4d88969562639ed8341-4c7e9.jpg 345w,\n/static/codepen-3b3cf4a4706af4d88969562639ed8341-67d4c.jpg 600w"\n        sizes="(max-width: 600px) 100vw, 600px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Source of image: Screenshot of <a href="http://codepen.io/">CodePen</a></em></p>\n<h3 id="layout"><a href="#layout" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Layout</h3>\n<p>There are three input panels allowing you to enter markup, styles and\nscripts complimented by a result panel.</p>\n<p>To avoid context-switching and for\n<a href="https://blog.codepen.io/2016/01/27/new-feature-javascript-console/">other reasons</a>\nthere is a development console available.</p>\n<p>They have also catered for the keyboard-focused developer by adding some rad\nshortcuts.</p>\n<h3 id="preprocessors"><a href="#preprocessors" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Preprocessors</h3>\n<p>There is support for many popular preprocessors for HTML, CSS and JavaScript\nand it even lets you view the compiled source.</p>\n<h3 id="styling-and-scripting-features"><a href="#styling-and-scripting-features" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Styling and scripting features</h3>\n<p>You can normalize your base styles and automatically add vendor prefixing so that you\ndon\'t have to prefix everything yourself.</p>\n<p>You can reference external libraries and stylesheets or quickly select\nsome of the popular ones used.</p>\n<h3 id="code-formatting"><a href="#code-formatting" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Code formatting</h3>\n<p>Your code can get messy, especially if you are writing it quickly. Sometimes you\nalso end up pasting code that isn\'t formatted correctly or doesn\'t follow your\nformatting. You can tidy up your code by using the tidy feature.\nYou can also validate your stylesheets and scripts by linting them.</p>\n<h3 id="sharing"><a href="#sharing" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Sharing</h3>\n<p>Once you have a pen rockin\' and rollin\' you can export it as a <code class="language-text">.zip</code> file,\nsave it as a gist, share it on social media or embed it on your blog like this\none:</p>\n<figure>\n  <p data-height="350" data-theme-id="0" data-slug-hash="mJBYqy" data-default-tab="css,result" data-user="maneeshc" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/maneeshc/pen/mJBYqy/">Digital Clock</a> by Maneesh (<a href="http://codepen.io/maneeshc">@maneeshc</a>) on <a href="http://codepen.io">CodePen</a>.</p>\n  <script async src="//assets.codepen.io/assets/embed/ei.js"></script>\n  <figcaption>Old school digital clock pen by <a href="http://codepen.io/maneeshc">Maneesh Chiba</a></figcaption>\n</figure>\n<h2 id="jsfiddle"><a href="#jsfiddle" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>JSFiddle</h2>\n<p><a href="https://jsfiddle.net/">JSFiddle</a> let\'s you test your front end web code\nwith their online code editor. You can follow this\n<a href="http://doc.jsfiddle.net/tutorial.html">tutorial</a>\nto learn how to get started with it.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/jsfiddle-fac7aea302edd25127d781bf22048a8d-39c3a.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 593px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.62225969645868%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Screenshot"\n        title="JSFiddle layout"\n        src="/static/jsfiddle-fac7aea302edd25127d781bf22048a8d-39c3a.jpg"\n        srcset="/static/jsfiddle-fac7aea302edd25127d781bf22048a8d-9c204.jpg 173w,\n/static/jsfiddle-fac7aea302edd25127d781bf22048a8d-75dbe.jpg 345w,\n/static/jsfiddle-fac7aea302edd25127d781bf22048a8d-39c3a.jpg 593w"\n        sizes="(max-width: 593px) 100vw, 593px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Source of image: Screenshot of <a href="http://jsfiddle.net/">JSFiddle</a></em></p>\n<h3 id="layout-1"><a href="#layout-1" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Layout</h3>\n<p>There are three input panels allowing you to enter HTML, styling and\nscripting complimented by a result panel.</p>\n<p>There is a sidebar that let\'s you create a title and description for your\nfiddle, reference external resources, gives you more information about\nAJAX requests and a link to their roadmap.</p>\n<h3 id="preprocessors-1"><a href="#preprocessors-1" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Preprocessors</h3>\n<p>Preprocessors are not well supported at the moment. None for markup,\n<code class="language-text">SCSS</code> for styling and <code class="language-text">TypeScript</code>, <code class="language-text">CoffeeScript</code> and <code class="language-text">Babel</code> for scripting.\nTheir <a href="https://trello.com/b/LakLkQBW/jsfiddle-roadmap">roadmap</a> indicates\nthey may possibly support these in the future.</p>\n<h3 id="markup-styling--scripting-features"><a href="#markup-styling--scripting-features" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Markup, styling &#x26; scripting features</h3>\n<p>You can select the flavor of HTML you wish to use in the <code class="language-text">doctype</code> and\nnormalize your base styles.</p>\n<p>They offer a wide range of libraries and versions that you can reference from\nwithin the JavaScript settings. Some include <code class="language-text">mootools</code>, <code class="language-text">jQuery</code> and <code class="language-text">prototype</code>.\nYou can even specify how your JavaScript should be loaded: <code class="language-text">onLoad</code>,\n<code class="language-text">onDomready</code> <code class="language-text">head</code> or <code class="language-text">body</code>.</p>\n<h3 id="code-formatting-1"><a href="#code-formatting-1" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Code formatting</h3>\n<p>You can tidy your code when it gets messy and unreadable.</p>\n<h3 id="sharing-1"><a href="#sharing-1" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Sharing</h3>\n<p>Your fiddle can be saved, embedded and collaborated on in real time. If you\nsee a fiddle you like, you can fork it and play around with it without affecting\nthe original one.</p>\n<h2 id="stackoverflow"><a href="#stackoverflow" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>StackOverflow</h2>\n<p><a href="http://stackoverflow.com/">StackOverflow</a> has added their own code snippet\nflavor to their answering platform for HTML, CSS and JavaScript.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/stackoverflow-ebfbd9b3a79ae6c74b0662381d38e5cd-5c347.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 614px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 74.42996742671009%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Screenshot"\n        title="StackOverflow code snippet functionality"\n        src="/static/stackoverflow-ebfbd9b3a79ae6c74b0662381d38e5cd-5c347.jpg"\n        srcset="/static/stackoverflow-ebfbd9b3a79ae6c74b0662381d38e5cd-344c5.jpg 173w,\n/static/stackoverflow-ebfbd9b3a79ae6c74b0662381d38e5cd-fac78.jpg 345w,\n/static/stackoverflow-ebfbd9b3a79ae6c74b0662381d38e5cd-5c347.jpg 614w"\n        sizes="(max-width: 614px) 100vw, 614px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Source of image: Screenshot of <a href="http://stackoverflow.com/">StackOverflow</a></em></p>\n<p>You can quickly write front end code from within the StackOverflow platform.</p>\n<p>It allows you to reference a version of <code class="language-text">jQuery</code>, <code class="language-text">AngularJS</code>, <code class="language-text">d3</code>, <code class="language-text">Knockout</code>\nor reference an external library.</p>\n<p>You can also tidy your code when it gets messy so that your questions and\nanswers are easier to follow.</p>\n<p>Once you are done, you can insert the code as an interactive widget\ndirectly into your question or answer. How cool is that?</p>\n<h2 id="sqlfiddle"><a href="#sqlfiddle" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>SQLFiddle</h2>\n<p><a href="http://sqlfiddle.com/">SQLFiddle</a> let\'s you create, build and populate tables\nwith T-SQL scripts on a variety of relational databases including MySql,\nOracle, PostgreSQL, SQLite and MS SQL Server.</p>\n<p>Check <a href="http://sqlfiddle.com/about.html">this</a> out if you want to learn more\nabout it.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sqlfiddle-b7684ae38f889c8ed9d8c2b41cb960e3-6c221.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 581px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 53.87263339070568%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Screenshot"\n        title="SQL Fiddle layout"\n        src="/static/sqlfiddle-b7684ae38f889c8ed9d8c2b41cb960e3-6c221.jpg"\n        srcset="/static/sqlfiddle-b7684ae38f889c8ed9d8c2b41cb960e3-96bb4.jpg 173w,\n/static/sqlfiddle-b7684ae38f889c8ed9d8c2b41cb960e3-a55c1.jpg 345w,\n/static/sqlfiddle-b7684ae38f889c8ed9d8c2b41cb960e3-6c221.jpg 581w"\n        sizes="(max-width: 581px) 100vw, 581px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Source of image: Screenshot of <a href="http://sqlfiddle.com/">SQL Fiddle</a></em></p>\n<h3 id="schema-creation"><a href="#schema-creation" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Schema creation</h3>\n<p>You can create a schema by either entering <code class="language-text">T-SQL</code> or by using their Text\nto DDL feature where you can paste or type out CSV, space separated or\npipe-delimited sample data.</p>\n<h3 id="schema-browser"><a href="#schema-browser" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Schema browser</h3>\n<p>There is a schema browser so that you can quickly see your tables and columns\nin an interactive tree view.</p>\n<h3 id="code-formatting-2"><a href="#code-formatting-2" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Code formatting</h3>\n<p>You can format your code when it gets messy and enter full screen mode when\nyou need more real estate to play with.</p>\n<h3 id="sharing-2"><a href="#sharing-2" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Sharing</h3>\n<p>Your fiddles are saved but you will have to copy the URL in order to share it.</p>\n<hr>\n<h2 id="references"><a href="#references" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>References</h2>\n<ul>\n<li><a href="https://fiddles.io/">Fiddles.io</a></li>\n<li><a href="http://codepen.io/">CodePen</a></li>\n<li><a href="https://jsfiddle.net/">JSFiddle</a></li>\n<li><a href="http://sqlfiddle.com/">SQLFiddle</a></li>\n<li><a href="https://www.sitepoint.com/7-code-playgrounds/">7 of the Best Code Playgrounds</a>\nby Craig Buckler at Sitepoint.</li>\n</ul>',timeToRead:6,excerpt:"If you are new to fiddles, it's an online code playground that let's you\nquickly experiment, visualize results and share code without having…",frontmatter:{title:"Discovering fiddles",cover:"https://picsum.photos/1280/500/?image=527",date:"2016-06-19 19:13:00 +0200",category:null,tags:["Technical","Productivity"]},fields:{slug:"/blog/discovering-fiddles"}},prev:{excerpt:"Accelerate your learning by sharing what you learn with others while you are\nlearning it. Experts aren't people…",frontmatter:{title:"What it means to be an expert",cover:"https://picsum.photos/1280/500/?image=26",date:"2016-06-22 21:10:43 +0200"},fields:{slug:"/blog/what-it-means-to-be-an-expert"}},next:{excerpt:"The HTML5 specification has introduced more elements to aid us with\nsemantic markup. I've discussed some of the…",frontmatter:{title:"Some new HTML5 elements",cover:"https://picsum.photos/1280/500/?image=526",date:"2016-06-18 13:26:44 +0200"},fields:{slug:"/blog/some-new-html-5-elements"}}},pathContext:{slug:"/blog/discovering-fiddles",total:57,prev:"/blog/what-it-means-to-be-an-expert",next:"/blog/some-new-html-5-elements"}}}});
